import React from 'react';
import logo from '../images/logo.jpg'
import './Navbar.css';

function Navbar() {


  return (
    <>
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <div className="container">
               <img className="navbar-logo" src={logo}></img>
            </div>
        </nav>
    </>
  );
}

export default Navbar;
